import React from 'react';
import '../Style.css';
import Testimonials from './Testimonials';
import Footer from './Footer';
import Services from './Services';
import Banner from './Banner';
import ContactSection from './ContactSection';
import OurTech from './OurTech';

const Home = () => {
  return (
    <>
      <Banner />
      <div className="back">
        <div className="container1"></div>
      </div>

      {/* WhatsApp Sticky Icon */}
      <a
        href="https://wa.me/1234567890" // Replace with your WhatsApp number
        className="whatsapp-icon"
        target="_blank"
        rel="noopener noreferrer"
      >
        <img
          src={process.env.PUBLIC_URL + '/whatsapp-icon.png'}
          alt="WhatsApp"
        />
      </a>

      {/* Comprehensive Digital Solutions */}
      <div className="container11">
        <div className="tut">
          <h1>ComprehensiveÂ Digital Solutions</h1>
          <p>The wise man therefore always holds in these matters to this principle of selection.</p>
        </div>
        <div className="com">
          {/* Solutions Sections */}
          {/* Add your solution blocks here */}
        </div>
      </div>

      <OurTech />
      <Services />
      <div className="test2">
        <div className="container ">
          <div className="tut tut2">
            <h1>Why customers love working with us</h1>
            <p>The wise man therefore always holds in these matters to this principle of selection.</p>
          </div>
          <div className="herosection">
            <Testimonials />
          </div>
        </div>
      </div>
      <ContactSection />
      <div className="footer">
        <Footer />
      </div>
    </>
  );
};

export default Home;
